import './itemcard.css';

const item = (param) => {
    return(
        <>
            <div id="card" className={param.flip}>
                <div id="textImg">
                    <span><a href="https://github.com/Virulentis" id="project_link"className={param.isLink}>Github</a></span>
                    <img src = {param.src} id="profile_photo"></img>
                </div>
                
                <div id="explanation">
                    <h1 id="title">{param.title}</h1>
                    <div id="desc">{param.desc}</div>
                </div>
                
            </div>
        </>
    )
};

export default item
